import React, {Component} from 'react';
import SERVICES from '../data/services0';
import ServiceCard from './ServiceCard';

export default class ServiceCardSpace extends Component{
  constructor(props){
    super(props);
  }

  render(){
    return(
      <div className="All-Services">
          {
              SERVICES.map((each)=>{
                  return (
                      <ServiceCard key={each.id} serviceCard={each} />
                  )
              })
          }
      </div>
    );
  }
}
